import React from "react";
import { Pane, Text, Button, Heading, Table } from "evergreen-ui";
import profiles from './profiles.json'
import background from "./Img/MyBookings.jpg";

function MyBookingsPage() {
  return (
    <div>
      <Pane backgroundImage={`url(${background})`} display="flex" alignItems="center" justifyContent="center" padding={100} flexDirection="column">
        <Heading fontSize={100} color={'white'}>My Bookings</Heading>
        <Text size={600} color={'white'}><br></br><br></br><br></br>View your past seat bookings</Text>
      </Pane>
      <Pane height={1000} backgroundColor="beige"  justifyContent="center" padding={20}>
        <Heading size={800} >Reset Account Password</Heading>
        <Table>
          <Table.Head>
            <Table.SearchHeaderCell />
            <Table.TextHeaderCell>
              Last Activity
    </Table.TextHeaderCell>
            <Table.TextHeaderCell>
              ltv
    </Table.TextHeaderCell>
          </Table.Head>
          <Table.Body height={240}>
            {profiles.map(profile => (
              <Table.Row key={profile.id} isSelectable onSelect={() => alert(profile.name)}>
                <Table.TextCell>{profile.name}</Table.TextCell>
                <Table.TextCell>{profile.lastActivity}</Table.TextCell>
                <Table.TextCell isNumber>
                  {profile.ltv}
                </Table.TextCell>
              </Table.Row>
            ))}
          </Table.Body>
        </Table>
      </Pane>
    </div>
  );
}

export default MyBookingsPage;
